window.bookSummaryJSON = "<p>The desert planet Arrakis, called Dune, has been destroyed. Now, the Bene Gesserit, heirs to Dune's power, have colonized a green world - and are tuning it into a desert, mile by scorched mile.</p> <p><i>Chapterhouse Dune</i> is the last book Frank Herbert wrote before his death: A stunning climax to the epic Dune legend that will live on forever.&nbsp;</p>"; 
